INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (20063115, 2834, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 2, "ペコリーヌとの出会い", 1, 7, "青空の下で謁見", 91002, 8, 0, 5118061, 10118, 40, "フリーマーケット会場");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (20063115, 2835, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 2, "マホとの出会い", 1, 7, "未来の騎空団\nマスコット？", 91002, 8, 0, 5118062, 10118, 40, "フリーマーケット会場");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (20063115, 2837, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 2, "アキノとの出会い", 1, 7, "お嬢さまからの\n緊急依頼", 91002, 8, 0, 5118063, 10118, 40, "ランドソル市街地");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (20063115, 4108402, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 2, "ジュンとの出会い", 1, 18, "黄金色の悩みごと", 91002, 8, 0, 5118064, 10118, 40, "フリーマーケット会場");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (20063115, 4107402, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 2, "カオリとの出会い", 1, 18, "白熱！　格闘大会！", 91002, 8, 0, 5118065, 10118, 40, "フリーマーケット会場");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (20063115, 9000227, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 2, "ニノンとの出会い", 1, 16, "祭り太鼓はオーエドの華", 91002, 8, 1, 5118066, 10118, 40, "オーエド町");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (20063115, 2101181, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 3, "スズナとの出会い", 1, 19, "人気者は遅れて\nやってくる", 91002, 8, 0, 5118067, 10118, 40, "フリーマーケット会場");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (20063115, 4109402, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 3, "ナナカとの出会い", 1, 18, "巫女・ミーツ・魔法少女", 91002, 8, 0, 5118068, 10118, 40, "ランドソル市街地");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (20063115, 4305402, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 3, "キャル＆コッコロとの出会い", 1, 18, "ネズ耳は二度なくなる", 91002, 8, 0, 5118069, 10118, 40, "フリーマーケット会場");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (20063115, 4101402, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 3, "ユカリとの出会い", 1, 18, "この出会いにカンパイ！", 91002, 8, 0, 5118070, 10118, 40, "ランドソル市街地");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (20063115, 4106402, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 3, "アオイとの出会い", 1, 18, "陰陽アンサンブル", 91002, 8, 0, 5118071, 10118, 40, "ランドソル市街地");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (20063115, 2836, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 3, "シノブとの出会い", 1, 7, "運試し十番勝負！", 91002, 8, 1, 5118072, 10118, 40, "フリーマーケット会場");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (20063115, 0, 0, 1, "オープニング", 0, 0, "彼女たちの新たな日常", 0, 0, 0, 5118600, 10118, 0, 0);
